import './App.css';
import React, { useState, useEffect } from 'react'

function App() {

  const [users, setUsers] = useState();

  useEffect(() => {
    fetch('http://localhost:3000/users').then(response => response.json()).then(data => setUsers(data))
  }, [])

  return (
    <>
      <p>wrpbgwrg</p>
      <h1>Users List</h1>
      <ul>
        {users.map((user) => {
          return (
            <>


              <li key={user.id}>{user.name}</li>
            </>
          )
        })}
      </ul>
    </>
  );
}

export default App;
